How to exclude specific fields from the query condition?<p>I am creating a webapp for users to query data from mongodb. I have front end using react and backend with nodejs hooking up mongodb.</p>

<p>I have included all relevant matching conditions under aggregate function. However I would like to have the effect of commenting out certain key-value pair, (by this I mean nullifying the effect of the query field condition). For example,</p>

<pre><code>router.get('/getmongo', function(req, res) {
  MongoClient.connect(process.env.DB_CONN, function(err, db) {
  if (err) throw err;    
    db.aggregate([
      {
        $match:{
          'employmentStatus':/employed|unemployed/i,
          'gender':{$in:["male","female"]},
          'age':{$gte:20, $lte:30}
      }
    },
    { "$group": {
        "_id": "$employmentStatus",
        "count": { "$sum": 1 }
        }}
    ]).limit(4).toArray(function(err, docs) {
    if (err) throw err;
    res.send(JSON.stringify(docs))
    db.close();
  })
})
</code></pre>

<p>Let say on front end, the user does not select the option of age, which means there is no specification from the user's end on the age criteria. Usually for this case, users would comment out or remove the whole line of age query on MongoDB GUI, leaving only employmentStatus and gender as the only two criteria to query. I was looking into mongoAPI but can't find any useful tool to replicate that effect. Any idea or suggestion?
(I am using Mongo v2.3.3 by the way)</p>

