Mongodb 3.2 (Aggregation) : Group by multiple values of the same attribute<p>I have the following count queries : </p>

<pre><code>db.collection.count({code : {$in : ['delta', 'beta']}});
db.collection.count({code : 'alpha'});
</code></pre>
for the given data set

<pre><code>[
    {
        "code": "detla",
        "name": "delta1"
    },
    {
        "code": "detla",
        "name": "delta2"
    },
    {
        "code": "detla",
        "name": "delta3"
