    },
    {
        "code": "alpha",
        "name": "alpha2"
    },
    {
        "code": "alpha",
        "name": "alpha3"
    }
]
</code></pre>

<p>Is there any way to achieve this using <strong><em>single aggregation()</em></strong> and nested $group in <strong>mongodb@3.2</strong>?
