Mongoose: Remove elements from array of objects in Mongo if condition is met<p>I have an array of objects that stores the date of an API request along with the JSON values of the request and response. The issue is I don't want this log to get massive. I need to set a max limit or remove entries older than a particular date.</p>

<p>I'm trying to use a mongo / mongoose query to delete elements of an array when the date value of that object is greater than 5 days.</p>

<p>This is the relevant section the mongo model:</p>

<pre><code>
      log: [
        {
          select: false,
          date: {
            type: Date,
            default: Date.now,
            select: false
          },
          request: { type: String, select: false },
          response: { type: String, select: false }
        }
      ]

</code></pre>

<p>I've tried using updateMany and $pull</p>

<pre><code>
    const fiveDaysAgo = moment()
      .subtract(5, 'day')
      .format('YYYY-MM-DD');

    // Ensure log value exists in collection
    // Remove any log entry older than five days
    Collection.updateMany(
      { log: { $exists: true } },
      { $pull: { 'log.$[].date': { $gte: fiveDaysAgo } } }
    ).then(data =&gt; console.log(data));

</code></pre>

<p>This produces this error:</p>

<pre><code>(node:1957) UnhandledPromiseRejectionWarning: MongoError: Cannot apply $pull to a non-array value
</code></pre>

<p>If there was a way to set a max value of entires in the array of objects, and automatically pop the oldest entry off when the new entry is inserted that would also work for me.</p>

