MongoDB query for set difference of collection groups<p>Given a set of <code>modified</code> records and an <code>original</code> set of records. I want to be able to write a query that will essentially give me the set difference from the <code>original</code> "set" to the <code>modified</code> "set".</p>

<p>So given two sets, <code>original</code> and <code>modified</code> like so:</p>

<pre><code>{ "_id" : 1, "set": "original", "key" : "foo", "element" : "bar" }
{ "_id" : 2, "set": "original", "key" : "bar", "element" : "old" }
{ "_id" : 3, "set": "original", "key" : "qux", "element" : "abc" } # Deleted

{ "_id" : 4, "set": "modified", "key" : "foo", "element" : "bar" } # Unchanged
{ "_id" : 5, "set": "modified", "key" : "bar", "element" : "new" } # Changed
{ "_id" : 6, "set": "modified", "key" : "baz", "element" : "bar" } # Created
</code></pre>

<p>I want to get some sort of result from the difference query that either looks like a cursorable set of documents, like:</p>

<pre><code>{ "_id" : 3, "deleted": True}
{ "_id" : 5, "changed": True}
{ "_id" : 6, "created": True}
</code></pre>

<p>Or less ideal (only because it's not as <code>cursor</code>-able):</p>

<pre><code>{
    "deleted": [3],
    "changed": [5],
    "created": [6]
}
</code></pre>

<p>I'm not restricted to result formats, but rather just want to figure out how to do this calculation and want to demonstrate what I'm looking for.</p>

<p>I see that Mongo has a <a href="https://docs.mongodb.com/manual/reference/operator/aggregation/setDifference/" rel="nofollow noreferrer"><code>$setDifference</code></a> feature, but I'm having trouble applying it to my problem.</p>

