Spring boot mongo audit @version issue<p>I just started a new project and would like to use Sprint Boot 2.1 and ran into a problem at the very beginning. What I would like to do is use Spring Boot Mongo to manage the database. I would like to have an optimistic lock with <code>@Version</code> annotation. However, I found that it seems like <code>@Version</code> would affect the <code>save()</code> behavior in MongoRepository, which means, dup key error. <br></p>

<p>The following is the sample code. <br><br>
<strong>POJO</strong><br></p>

<pre><code>    @Data
    @AllArgsConstructor
    @NoArgsConstructor
    @Document
    public class Person {

        @Id public ObjectId id;
        @CreatedDate public LocalDateTime createOn;
        @LastModifiedDate public LocalDateTime modifiedOn;
        @Version public long version;
        private String name;
        private String email;

        public Person(String name, String email) {
            this.name = name;
            this.email = email;
        }

       @Override
        public String toString() {
            return String.format("Person [id=%s, name=%s, email=%s, createdOn=%s, modifiedOn=%s, version=%s]", id, name, email, createOn, modifiedOn, version);
        }
    }
</code></pre>

<p><strong>MongoConfig</strong><br></p>

<pre><code>    @Configuration
    @EnableMongoRepositories("com.project.server.repo")
    @EnableMongoAuditing
    public class MongoConfig {

    }
</code></pre>

<p><strong>Repository</strong><br></p>

<pre><code>    public interface PersonRepo extends MongoRepository&lt;Person, ObjectId&gt; {
        Person save(Person person);
        Person findByName(String name);
        Person findByEmail(String email);
        long count();
        @Override
        void delete(Person person);
    }
</code></pre>

<p>As indicated in <a href="https://docs.spring.io/spring-data/couchbase/docs/current/reference/html/#version" rel="nofollow noreferrer">Official Doc</a>, I have my <code>version</code> field in <code>long</code>, but the dup key error occurs at the second <code>save</code>, which means it tried to <code>insert</code> again, even with the id in the object. <br>
I also tried with <code>Long</code> in <code>version</code> field, which has no dup key occurred and save as update as expected, but the <code>createdOn</code> become <code>null</code> in the first <code>save</code> (which means <code>insert</code>)</p>

